INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ＴＰダウンカット", "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", 603000406, 76030004, "boss_tp_down_cut");
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("全属性ボーナス特大アップ", "同属性のキャラが４体以上編成されているとき、キャラの属性ボーナスが強化される。", 603000501, 76030005, 33);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ダメージ減衰", "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 603000502, 76030005, 18);
INSERT INTO `v1_0b52d19c3bab9981abbabab91a91fc047923e89a7285a6a773a343749b6f6fdd` VALUES ("ＴＰ上昇上限付与", "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 603000503, 76030005, 17);
